,"research","methods","disciplines","statistical","history"],"name":"Social Sciences","description":"Social sciences Specializations and courses explore how populations form laws, make decisions, behave in groups, and structure their communities. From education to economics to law, courses in the social sciences will improve your understanding of the dynamics between individuals and groups, and your ability to analyze behaviors and trends.","id":"social-sciences"},{"subdomainIds":["learning-english","other-languages"],"keywords":["lessons","learn","language learning","learn chinese","learn english","english language courses","learn to speak","foreign language","spanish","other languages","grammar","speaking","conversation","writing"],"name":"Language Learning","description":"In language courses and Specializations, you’ll learn to speak, write, and listen effectively in major global languages, including English, Chinese, Spanish, and more. Whether you’re learning a foreign language or improving your communication skills in your native language, coursework in this area will help you understand grammar and syntax conventions, and will prepare you to communicate with confidence in both business interactions and casual conversation.","id":"language-learning"}],"courseId":"jigZGJrqEey10AoWlnmjtw","courseSlug":"introduction-to-front-end-development","courseCertificates":["VerifiedCert","Specialization"],"courseTypeMetadata":{"typeName":"standardCourse","definition":{"typeNameIndex":"standardCourse"}},"rawCourseMaterials":{"courseData":{"isReal":true,"certificatePurchaseEnabledAt":1646309273966,"estimatedWorkload":"4 semaines d'études, 4 à 8 heures par semaine.","description":"Bienvenue dans Introduction au développement frontal, le premier cours du programme Meta Front-End Developer.  \n\nCe cours est un bon point de départ si vous souhaitez devenir développeur web. Vous découvrirez les responsabilités quotidiennes d'un développeur web et obtiendrez une compréhension générale des technologies de base et sous-jacentes qui alimentent l'Internet. Vous apprendrez comment les développeurs frontaux créent des sites web et des applications qui fonctionnent bien et sont faciles à maintenir. \n\nVous serez initié aux technologies de base du développement web telles que HTML et CSS et aurez l'occasion de vous exercer à les utiliser. Vous serez également initié aux cadres modernes d'interface utilisateur tels que Bootstrap et React qui facilitent la création d'expériences utilisateur interactives. \n\nÀ la fin du cours, vous serez en mesure de : \n- Décrire le rôle du développeur front-end - Expliquer les technologies de base et sous-jacentes qui alimentent l'Internet - Utiliser HTML pour créer une page web simple - Utiliser CSS pour contrôler l'apparence d'une page web simple - Expliquer ce qu'est React - Décrire les applications et les caractéristiques des cadres d'interface utilisateur les plus populaires Pour le projet final de ce cours, vous créerez et éditerez une page web en utilisant HTML et le cadre CSS Bootstrap. En utilisant une grille de mise en page réactive, vous construirez une page web réactive contenant du texte et des images qui s'affichent parfaitement sur n'importe quelle taille d'écran. \n\nIl s'agit d'un cours pour débutants destiné aux apprenants désireux d'apprendre les bases du développement web. Pour réussir ce cours, vous n'avez pas besoin d'une expérience préalable en matière de développement web, mais seulement de compétences de base en matière de navigation sur Internet et d'une envie de commencer à coder.","isRestrictedMembership":false,"domainTypes":[{"subdomainId":"mobile-and-web-development","domainId":"computer-science"},{"subdomainId":"cloud-computing","domainId":"information-technology"}],"verificationEnabledAt":1646309273966,"isVerificationEnabled":true,"sessionsEnabledAt":1646309273966,"brandingImage":"https:\u002F\u002Fcoursera-course-photos.s3.amazonaws.com\u002F16\u002F82f78b532f441cab32ddb1019d7d25\u0 pment languages like JavaScript and React. You’ll learn to edit images and wireframes and work with content management systems (CMS). In contrast, the\u003Cstrong\u003E back-end developer certificate\u003C\u002Fstrong\u003E focuses on essential back-end languages and technologies like Python, SQL, APIs, XML, and web server software. Both certificate programs cover the basics of HTML, CSS, and version control.&#xa0;\u003C\u002Ftext\u003E\u003C\u002Fli\u003E\u003C\u002Flist\u003E\u003Ctext\u003EFor an in-depth comparison of each career path, consider reading the article \u003Ca href=\"https:\u002F\u002Fwww.coursera.org\u002Farticles\u002Ffront-end-vs-back-end\" title=\"\"\u003EFront End vs. Back End: Learning Skills and Tools\u003C\u002Fa\u003E.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cul\u003E\u003Cli\u003E\u003Cp data-text-variant=\"body1\"\u003EThe \u003Cstrong\u003Efront-end developer certificate\u003C\u002Fstrong\u003E focuses on front end development languages like JavaScript and React. You’ll learn to edit images and wireframes and work with content management systems (CMS). In contrast, the\u003Cstrong\u003E back-end developer certificate\u003C\u002Fstrong\u003E focuses on essential back-end languages and technologies like Python, SQL, APIs, XML, and web server software. Both certificate programs cover the basics of HTML, CSS, and version control.&nbsp;\u003C\u002Fp\u003E\u003C\u002Fli\u003E\u003C\u002Ful\u003E\u003Cp\u003EFor an in-depth comparison of each career path, consider reading the article \u003Ca href=\"https:\u002F\u002Fwww.coursera.org\u002Farticles\u002Ffront-end-vs-back-end\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EFront End vs. Back End: Learning Skills and Tools\u003C\u002Fa\u003E.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat does a front-end developer do?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat does a front-end developer do?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EFront-End Developers focus on the design, look, and feel of a website. They design engaging online user experiences that generate excitement and encourage repeat visits. They work closely with designers to make websites beautiful, functional and fast.\u003C\u002Ftext\u003E\u003Ctext\u003EIf you like thinking creatively, building better experiences and are interested in visual design, this is a great career path for you.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EFront-End Developers focus on the design, look, and feel of a website. They design engaging online user experiences that generate excitement and encourage repeat visits. They work closely with designers to make websites beautiful, functional and fast.\u003C\u002Fp\u003E\u003Cp\u003EIf you like thinking creatively, building better experiences and are interested in visual design, this is a great career path for you.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhy should I earn a Meta developer certificate?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhy should I earn a Meta developer certificate?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThe Meta Developer Certificates are for anyone who has a passion for tech and wants to build a career in this field, no degree or experience necessary. Upon completion, you’ll earn career credentials from Meta that you can add to your resume and portfolio. A Meta Certificate is an industry-recognized credential that helps boost confidence and gives you a competitive advantage when applying to jobs. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThe Meta Developer Certificates are for anyone who has a passion for tech and wants to build a career in this field, no degree or experience necessary. Upon completion, you’ll earn career credentials from Meta that you can add to your resume and portfolio. A Meta Certificate is an industry-recognized credential that helps boost confidence and gives you a competitive advantage when applying to jobs. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EIs a Meta Professional Certificate worth it?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003 \u003EEarned a \u003Ca href=\"https:\u002F\u002Fwww.facebook.com\u002Fbusiness\u002Flearn\u002Fcertification\u002Ffaqs\u002Fmain-value#:~:text=A%20Meta%20Certification%20can%20help,knowledge%20of%20the%20Meta%20platform.\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EProfessional Certificate\u003C\u002Fa\u003E that proves your expertise to employers \u003C\u002Fp\u003E\u003Cp\u003E\u003C\u002Fp\u003E\u003Cp\u003EGain more insight to help you decide if this program aligns with your goals by reading \u003Ca href=\"https:\u002F\u002Fwww.coursera.org\u002Flearn\u002Fintroduction-to-front-end-development\u002Freviews\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EMeta Front-End Developer Certificate reviews\u003C\u002Fa\u003E. \u003C\u002Fp\u003E\u003Cp\u003E\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat jobs will this prepare me for?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat jobs will this prepare me for?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThere are multiple branches of software engineering you can specialize in, and each one comes with a unique set of responsibilities. You can work as a front-end developer, full stack developer, back-end developer, database engineer, cross-platform mobile developer, software engineer, web designer and so many more. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThere are multiple branches of software engineering you can specialize in, and each one comes with a unique set of responsibilities. You can work as a front-end developer, full stack developer, back-end developer, database engineer, cross-platform mobile developer, software engineer, web designer and so many more. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat type of companies hire front-end developers?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat type of companies hire front-end developers?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ESoftware engineering is needed in nearly every industry, every business and for every function. It helps build, design and develop technology. The demand for this skillset has grown immensely over the last year and will continue to rise as new technologies emerge.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ESoftware engineering is needed in nearly every industry, every business and for every function. It helps build, design and develop technology. The demand for this skillset has grown immensely over the last year and will continue to rise as new technologies emerge.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhy start a career in front-end development?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhy start a career in front-end development?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ESoftware Engineers are among the highest-paid jobs in the tech industry and the need for this skillset is on the rise. This career path is projected to grow by 22% by 2030 which is faster than the average projected rate of growth for all occupations (5%).\u003Ca href=\"https:\u002F\u002Fwww.bls.gov\u002Fooh\u002Fcomputer-and-information-technology\u002Fsoftware-developers.htm\" title=\"\"\u003E In 2020, there were more than 1.8 million jobs in the U.S. alone. \u003C\u002Fa\u003E\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ESoftware Engineers are among the highest-paid jobs in the tech industry and the need for this skillset is on the rise. This career path is projected to grow by 22% by 2030 which is faster than the average projected rate of growth for all occupations (5%).\u003Ca href=\"https:\u002F\u002Fwww.bls.gov\u002Fooh\u002Fcomputer-and-information-technology\u002Fsoftware-developers.htm\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003E In 2020, there were more than 1.8 million jobs in the U.S. alone. \u003C\u002Fa\u003E\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat background knowledge is necessary?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat background knowledge is necessary?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThe Meta Front-End Developer Professional Certificate is beginner level. There are no prerequisites required. You can prepare yourself to succeed in this program by familiarizing yourself with the subject matter prior to enrolling. Consider getting started by reading articles like \u003Ca href=\"https:\u002F\u002Fwww.coursera.org\u002Farticles\u002Ffront-end-developer\" title=\"\"\u003EWhat Does a Front-End Developer Do?\u003C\u002Fa\u003E and \u003Ca href=\"https:\u002F\u002Fwww.coursera.org\u002Farticles\u002Ffront-end-developer-interview-questions?trk_ref=relatedArticlesCard\" title=\"\"\u003E8 Front-End Developer Interview Questions + How to Answer Them\u003C\u002Fa\u003E.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThe Meta Front-End Developer Professional Certificate is beginner level. There are no prerequisites required. You can prepare yourself to succeed in this program by familiarizing yourself with the subject matter prior to enrolling. Consider getting started by reading articles like \u003Ca href=\"https:\u002F\u002Fwww.coursera.org\u002Farticles\u002Ffront-end-developer\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EWhat Does a Front-End Developer Do?\u003C\u002Fa\u003E and \u003Ca href=\"https:\u002F\u002Fwww.coursera.org\u002Farticles\u002Ffront-end-developer-interview-questions?trk_ref=relatedArticlesCard\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003E8 Front-End Developer Interview Questions + How to Answer Them\u003C\u002Fa\u003E.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EHow long does it take to complete this Professional Certificate?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EHow long does it take to complete this Professional Certificate?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EThis program will take approximately 4 months to complete, learning 10 hours a week. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EThis program will take approximately 4 months to complete, learning 10 hours a week. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EHow much does the Meta Front-End Developer Professional Certificate cost?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EHow much does the Meta Front-End Developer Professional Certificate cost?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext variant=\"body1\"\u003EThere are a few different ways to enroll in this program. You can:\u003C\u002Ftext\u003E\u003Ctext variant=\"body1\"\u003E\u003Cstrong\u003EEnroll for free and begin a 7-day trial, which then transitions into a \u003C\u002Fstrong\u003E\u003Ca href=\"https:\u002F\u002Fwww.coursera.org\u002Fcourseraplus\" title=\"\"\u003E\u003Cstrong\u003Esubscription to Coursera Plus\u003C\u002Fstrong\u003E\u003C\u002Fa\u003E\u003Cstrong\u003E.\u003C\u002Fstrong\u003E Coursera Plus subscriptions not only grant access to this Professional Certificate, but over 90% of Coursera’s course catalog. You can cancel at any time.&#xa0;\u003C\u002Ftext\u003E\u003Ctext variant=\"body1\"\u003E\u003Cstrong\u003EAudit the courses in the program for free.\u003C\u002Fstrong\u003E Auditing means to attend a course informally, without paying or earning academic credentials. Your work will not be graded, some content may be inaccessible, and you will not earn the certificate upon completion. If you change your mind while auditing, you can switch to a paid option at any time.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003E\u003C\u002Ftext\u003E\u003Ctext\u003EFor more financial options and information, visit our \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002F209818613-Enrollment-options?language=en_US\" title=\"\"\u003EEnrollment Options\u003C\u002Fa\u003E page. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp data-text-variant=\"body1\"\u003EThere are a few different ways to enroll in this program. You can:\u003C\u002Fp\u003E\u003Cp data-text-variant=\"body1\"\u003E\u003Cstrong\u003EEnroll for free and begin a 7-day trial, which then transitions into a \u003C\u002Fstrong\u003E\u003Ca href=\"https:\u002F\u002Fwww.coursera.org\u002Fcourseraplus\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003E\u003Cstrong\u003Esubscription to Coursera Plus\u003C\u002Fstrong\u003E\u003C\u002Fa\u003E\u003Cstrong\u003E.\u003C\u002Fstrong\u003E Coursera Plus subscriptions not only grant access to this Professional Certificate, but over 90% of Coursera’s course catalog. You can cancel at any time.&nbsp;\u003C\u002Fp\u003E\u003Cp data-text-variant=\"body1\"\u003E\u003Cstrong\u003EAudit the courses in the program for free.\u003C\u002Fstrong\u003E Auditing means to attend a course informally, without paying or earning academic credentials. Your work will not be graded, some content may be inaccessible, and you will not earn the certificate upon completion. If you change your mind while auditing, you can switch to a paid option at any time.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003E\u003C\u002Fp\u003E\u003Cp\u003EFor more financial options and information, visit our \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002F209818613-Enrollment-options?language=en_US\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EEnrollment Options\u003C\u002Fa\u003E page. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003ECan I take individual courses from this program?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003ECan I take individual courses from this program?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EYes, you can take individual courses within this program. Because the courses ascend in difficulty, it is recommended to take them in order but not required. However, you must complete all the courses to earn the Professional Certificate in front-end development from Meta. If you prefer to take an individual course, you can earn a \u003Cem\u003Ecourse certificate\u003C\u002Fem\u003E instead. Learn more about how course certificates differ from Professional Certificates on our \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002F208280196-Course-Certificates?language=en_US\" title=\"\"\u003ECourse Certificate page\u003C\u002Fa\u003E in the \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Flearner-help-center?language=en_US\" title=\"\"\u003EHelp Center\u003C\u002Fa\u003E.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":false,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EYes, you can take individual courses within this program. Because the courses ascend in difficulty, it is recommended to take them in order but not required. However, you must complete all the courses to earn the Professional Certificate in front-end development from Meta. If you prefer to take an individual course, you can earn a \u003Cem\u003Ecourse certificate\u003C\u002Fem\u003E instead. Learn more about how course certificates differ from Professional Certificates on our \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Farticle\u002F208280196-Course-Certificates?language=en_US\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003ECourse Certificate page\u003C\u002Fa\u003E in the \u003Ca href=\"https:\u002F\u002Fwww.coursera.support\u002Fs\u002Flearner-help-center?language=en_US\" title=\"\" target=\"_blank\" rel=\"noopener nofollow\" aria-label=\"\"\u003EHelp Center\u003C\u002Fa\u003E.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EDo I need to take the courses in a specific order?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EDo I need to take the courses in a specific order?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EIt is recommended to take each course in the order that they are listed as each course builds on the skills of the previous. Unless you are taking the course with prior knowledge, you may find you are unable to complete a later course if you have not completed the previous courses as you will not have the required skills. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EIt is recommended to take each course in the order that they are listed as each course builds on the skills of the previous. Unless you are taking the course with prior knowledge, you may find you are unable to complete a later course if you have not completed the previous courses as you will not have the required skills. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhat resources will be available to help me with my job search?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhat resources will be available to help me with my job search?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWe’ll guide you through each step to ensure you master the core programming skills at a pace that works for you. You’ll get expert-led training and build on-the-job experience through hands-on projects that you can add to your portfolio and show to recruiters.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EWe’ll help you develop a strong portfolio, a polished resume and sharp interview skills. We’ll prepare you for what to expect when interviewing for relevant roles and we’ll share tips for what employers are looking for in potential candidates.&#xa0;\u003C\u002Ftext\u003E\u003Ctext\u003EFinally, you’ll also get to discuss the emotional components of the interview process with other learners taking this course.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWe’ll guide you through each step to ensure you master the core programming skills at a pace that works for you. You’ll get expert-led training and build on-the-job experience through hands-on projects that you can add to your portfolio and show to recruiters.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EWe’ll help you develop a strong portfolio, a polished resume and sharp interview skills. We’ll prepare you for what to expect when interviewing for relevant roles and we’ll share tips for what employers are looking for in potential candidates.&nbsp;\u003C\u002Fp\u003E\u003Cp\u003EFinally, you’ll also get to discuss the emotional components of the interview process with other learners taking this course.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWhy did Meta create this program?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWhy did Meta create this program?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EMeta is committed to ensuring that anyone regardless of education, background or experience has the opportunity to learn in-demand skills so they can land an in-demand career. We're excited to provide these pathways so that millions of people can unlock greater opportunities for their lives and families. Upon completing this program, you’ll be well positioned to start your career as a software engineer.\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EMeta is committed to ensuring that anyone regardless of education, background or experience has the opportunity to learn in-demand skills so they can land an in-demand career. We're excited to provide these pathways so that millions of people can unlock greater opportunities for their lives and families. Upon completing this program, you’ll be well positioned to start your career as a software engineer.\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EDo I need a certain device to take this course?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EDo I need a certain device to take this course?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answer":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EYou must have a device capable of connecting to the internet and running the software throughout the course. \u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EYou must have a device capable of connecting to the internet and running the software throughout the course. \u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}}},{"question":{"typeName":"cml","definition":{"dtdId":"s12n\u002F1","value":"\u003Cco-content\u003E\u003Ctext\u003EWill I earn university credit for completing this Professional Certificate?\u003C\u002Ftext\u003E\u003C\u002Fco-content\u003E","renderableHtmlWithMetadata":{"metadata":{"hasMath":false,"isPlainText":true,"hasAssetBlock":false,"hasCodeBlock":false},"renderableHtml":"\u003Cdiv class=\"cmlToHtml-content-container\" style=\"white-space: pre-wrap\"\u003E\u003Cp\u003EWill I earn university credit for completing this Professional Certificate?\u003C\u002Fp\u003E\u003C\u002Fdiv\u003E"}}},"answ
